import React from 'react';
function Pageender (props){
  return(
    <div id='page-ender'>
    <br/>
    <a href="https://drive.google.com/file/d/1UP0xIJr7HcMgb4JaNrpWN9U-PmBOyd8h/view?usp=sharing" className="btn-trans" target='_blank'>View Resume</a><br/>
    <br/>
      <span>
        <a href='#about'><i class='fa fa-chevron-down' aria-hidden='true'></i></a>
      </span>
    </div>
  )
}
export default Pageender;
